import React from "react";
import './intro.css';
import { Link } from "react-scroll";
import btnImg from '../../assets/'

const Intro = () => {
    return(
        <section id="intro">
            <div id="introContent">
                <span className="hello">Hello,</span>
                <span className="introText">I'm <span className="intoName">Emmaunuel</span> <br /> Full Stack Software Enginerr </span>
                <p className="introPAra">I am a skilled full stack software developer with experience in creating visually appealing and user friendly websites.</p>
                <Link><button className="btn"><img src={btnImg} alt="Hire me" />Hire Me</button></Link>
            </div>
            <img src="" alt="profile" className="bg" />
        </section>
    )
}

export default Intro;
